import React from 'react';

// reactstrap components
import {  
  Button,  
  Container,
  Row,
  Col,
  Modal
} from "reactstrap";

class Landing extends React.Component{
  state = {
    exampleModal: false
  };
  toggleModal = state => {
    this.setState({
      [state]: !this.state[state]
    });
  };
    render(){
        return (
          <div className="position-relative">
            {/* shape Hero */}
            <section className="section section-lg section-shaped pb-40">
              <div className="shape shape-style-1 shape-default">
                {/* <span /> */}
                {/* <span /> */}
                {/* <span />                */}
                {/* <span /> */}
                {/* <span /> */}
                {/* <span /> */}
                {/* <span />                 */}
              </div>
              <Container className="py-lg-md d-flex">
                <div className="col px-0 ">
                  <Row className="text-center">
                    <Col>
                      <h2 className="display-3 text-white">
                        حساب، حسابه ...
                      </h2>
                      <p className="lead text-white">
                        اگه دانشجویی، اهل سفری یا با دوستات زندگی میکنی و میخوای حساب کتاب خرج و مخارج دستت باشه،                        
                        یه حساب کاربری ایجاد کن، گروه بساز، دوستات رو اضافه کن و مخارج رو مدیریت کن.
                      </p>
                      <div className="btn-wrapper">                        
                      <Button
          color="primary"
          type="button"
          onClick={() => this.toggleModal("exampleModal")}
        >
          ثبت نام
        </Button>
        {/* Modal */}
        <Modal
          className="modal-dialog-centered"
          isOpen={this.state.exampleModal}
          toggle={() => this.toggleModal("exampleModal")}
        >
          <div className="modal-header">
            <h5 className="modal-title" id="exampleModalLabel">
              Modal title
            </h5>
            <button
              aria-label="Close"
              className="close"
              data-dismiss="modal"
              type="button"
              onClick={() => this.toggleModal("exampleModal")}
            >
              <span aria-hidden={true}>×</span>
            </button>
          </div>
          <div className="modal-body">...</div>
          <div className="modal-footer">
            <Button
              color="secondary"
              data-dismiss="modal"
              type="button"
              onClick={() => this.toggleModal("exampleModal")}
            >
              Close
            </Button>
            <Button color="primary" type="button">
              Save changes
            </Button>
          </div>
        </Modal>
                      </div>
                    </Col>
                  </Row>
                </div>
              </Container>

            </section>
            {/* 1st Hero Variation */}
          </div>

          );
    }
}

export default Landing;
